Congratulations, @ejeancarroll1! 

@modelallianceny is proud to have championed the #AdultSurvivorsAct with our brave and brilliant survivor community, which made this win possible. Huge thanks to bill sponsors @bradhoylman & @lindabrosenthal_67. 

Survivors: there are six months left to file a claim under the Adult Survivors Act. We offer free, confidential support through our support line, MA Support.

@modelallianceny stands in solidarity with @SAGAFTRA as they strike for a fair contract that reflects the realities of working in today’s entertainment industry. Many fashion workers in our community also work as union-represented actors, and we commend them for their strength and courage in this critical moment.

Like actors, fashion workers also struggle for professional dignity behind a veil of glamour and prestige. However, because the law is currently unclear on whether models and other fashion workers can legally unionize, we have been been pursuing alternative forms of advocacy and organizing to improve our working conditions. That’s why the Model Alliance introduced the Fashion Workers Act, and it’s why we wholeheartedly support SAG-AFTRA and @writersguildwest @wgaeast. We urge studios to meet their demands now.

#SAGAFTRAstrong #SAGAFTRAstrike #WGAstrong #WGAstrike #FashionWorkersAct #Solidarity
